  "url": "https://www.google.com/"
  "interval": !!int "300"
  "proxies": *id001
- "name": "负载均衡"
  "type": "load-balance"
  "url": "https://www.google.com/"
  "interval": !!int "300"
  "strategy": "round-robin"
  "proxies": *id001
"rule-providers":
